(26, 1, 1, 'Round Ball Escape', 0, 'You think you got good control over your motor skills? Only one way to find out! Engage yourself in Round Ball Escape, a highly addictive and challenging game that lets you challenge yourself in a fun way and find out if you really got what it takes to be the master of motor skills!\r\n\r\n\r\nGoal is easy, all you got to do is dash your ball as high as you can to beat your rival’s score! Keep tapping on the screen at the right times to push your ball higher.\r\n\r\n\r\nSounds easy? Get this: DO NOT let the ball drop OR let it hit the moving bars! That’s right, the bars move horizontally, trying to close the ball’s path. Be super careful of them, if they close on you, you are a goner! Still think you are good? Hit the Install!\r\n\r\n\r\nIn order to start playing Round Ball Escape, you need to make an account on Game Loot Network and sign in using the registered information. No! You don’t have to worry about finding a website, when you launch Round Ball Escape for the first time, you will see the registration screen. Don’t worry! It’s just a few details. As soon as you register and sign in, you are good to go! Why all this? Because registering at Game Loot Network has a lot of perks! Visit: www.gamelootnetwork.com for more information!\r\n\r\n\r\nRound Ball Escape Features:\r\n• Easy to understand gameplay: Just tap to take your ball higher and avoid bars!\r\n• Minimalistic clean graphics to keep you focused on pushing the ball higher!\r\n• Awesome sounds.\r\n• Free and Paid leaderboards to make the gameplay more interesting and rewarding!\r\n• Tournaments to take your gaming experience to the next level!\r\n\r\n\r\nFor paid part, you need Tokens! Tokens, if you don’t already know, are the virtual currency used in all the fun games of Game Loot Network (www.gamelootnetwork.com ), that you can use to win exciting stuff available on Game Loot Rewards portal (www.gamelootrewards.com).\r\n\r\n\r\nSo what are you waiting for? Hit the INSTALL button now and start earning fame and super cool stuff by playing Round Ball Escape!', '123_572909dcb5651.png', '6718-round-ball.png', '', '83422-asdasd.PNG', 'https://play.google.com/store/apps/details?id=com.gamelootnetwork.RoundBallEscape', 'https://itunes.apple.com/us/app/round-ball-escape/id1014469656?mt=8', 'https://goo.gl/4oW5zA', '123_572909dcb55f6.png', '2015-12-02 16:21:27'),
(27, 3, 1, 'Loot Flyer', 0, 'Ever wanted to be a bird and fly across the horizon? Wish no more! Game Loot Network brings you Loot Flyer, an exciting and addicting game that lets you be a bird. Yes! You read right! Fly like a bird in Loot Flyer, a very adventurous game. That’s not all! You have to avoid the obstacles by either flying over them or under them! Oh and don’t forget to collect the gems! CAUTION: Endless addiction!\r\n\r\n\r\nHOW TO PLAY: The game play is easy (or is it?): The best part is that you don&#39;t have to worry about running, the running is automatic. All you got to do is focus on collecting Gems, avoiding and jumping over obstacles, Remember though, the game may seem easy, but it sure is hard to master!\r\n\r\n\r\nIn order to start playing Loot Flyer, you need to make an account on Game Loot Network and sign in using the registered information. No! You don’t have to worry about finding a website, when you launch Loot Flyer for the first time, you will see the registration screen. Don’t worry! It’s just a few details. As soon as you register and sign in, you are good to go! Why all this? Because registering at Game Loot Network has a lot of perks! Visit: www.gamelootnetwork.com for more information!\r\n\r\n\r\nLoot Flyer Features:\r\n• Amazing 3D graphics!\r\n• Great sounds! \r\n• Unlimited, Exciting and challenging gameplay!\r\n• Intuitive Controls that keep you alert as you play!\r\n• Different upgrades to make the game more enjoyable and exciting to play!\r\n• Score multiplier to make Loot Flyer a better and more challenging experience!\r\n• Free and Paid leaderboards to make the gameplay more interesting and rewarding!\r\n• Tournaments to take your gaming experience to the next level!\r\n\r\n\r\nFor paid part, you need Tokens! Tokens, if you don’t already know, are the virtual currency used in all the fun games of Game Loot Network (www.gamelootnetwork.com ), that you can use to win exciting stuff available on Game Loot Rewards portal (www.gamelootrewards.com).\r\n\r\n\r\nSo don’t wait any longer, Install Loot Flyer and start flying, collecting Gems and much much more!\r\n\r\n\r\nHappy gaming!', '123_572909f3517bd.png', '', '', '', 'https://play.google.com/store/apps/details?id=com.gamelootnetwork.lootflyer', 'https://itunes.apple.com/us/app/loot-flyer/id991725494?mt=8', 'https://goo.gl/uNbwnY', '123_572909f351762.png', '2015-12-02 16:13:23'),
(29, 2, 1, 'Ninja Runner Dash', 0, 'Brace yourself to indulge in amazing Ninjutsu action packed Ninja Runner Dash as you run across the streets of a temple collecting Ninja Stars! Fancy, right? That’s not it! You have the ability to dodge obstacles, run on walls (Sounds cool, doesn’t it?), turn tight corners and throw Ninja Stars with deadly accuracy! Yep, that’s the unique part about Ninja Runner Dash; Throw Ninja Stars at anything that comes in your way!\r\n\r\n\r\nHOW TO PLAY: The game play is simple (or is it?): The best part is that you don&#39;t have to worry about running, the running is automatic. All you got to do is focus on collecting Ninja Stars, avoiding and jumping over obstacles, run on walls when the pathway ends and shoot at whatever comes in your way using Ninja Stars! Remember though, the game may seem easy, but it sure is hard to master!\r\n\r\n\r\nIn order to start playing Ninja Runner Dash, you need to make an account on Game Loot Network and sign in using the registered information. No! You don’t have to worry about finding a website, when you launch Ninja Runner Dash for the first time, you will see the registration screen. Don’t worry! It’s just a few details. As soon as you register and sign in, you are good to go! Why all this? Because registering at Game Loot Network has a lot of perks! Visit: www.gamelootnetwork.com for more information!\r\n\r\n\r\nNinja Runner Dash Features:\r\n• Amazing 3D graphics!\r\n• Great sounds! \r\n• Unlimited, Exciting and challenging gameplay!\r\n• Intuitive Controls that keep you alert as you play!\r\n• Different upgrades to make the game more enjoyable and exciting to play!\r\n• Score multiplier to make Ninja Runner Dash a better and more challenging experience!\r\n• Free and Paid leaderboards to make the gameplay more interesting and rewarding!\r\n• Tournaments to take your gaming experience to the next level!\r\n\r\n\r\nFor paid part, you need Tokens! Tokens, if you don’t already know, are the virtual currency used in all the fun games of Game Loot Network (www.gamelootnetwork.com ), that you can use to win exciting stuff available on Game Loot Rewards portal (www.gamelootrewards.com).\r\n\r\n\r\nSo don’t wait any longer, Install Ninja Runner Dash and start shooting things in your way, run on walls and much much more!\r\n\r\n\r\nHappy gaming!', '123_57290a1348e36.png', '', '', '', 'https://play.google.com/store/apps/details?id=com.tastylemonapps.ninjarunner', 'https://itunes.apple.com/us/app/ninja-runner-dash/id966290741?mt=8', 'https://goo.gl/6atmm8', '123_57290a1348ddc.png', '2015-12-02 16:21:04'),
(31, 4, 12, 'Trivia Loot', 0, 'Challenge your friends in Trivia Loot, a unique rewards awarding multi-player trivia game, which let’s you earn Experience Points that ranks you among your friends in the interactive Leaderboards. Trivia Loot also offers you to play with Game Loot Tokens, a virtual currency that you can use on all the Game Loot Network platforms to have exclusive access to unlimited rewards and much more!\r\n\r\nTo make it even more challenging, Trivia Loot also offers Tournaments to take the competition to the next level. The game gets serious when you compete in the tournaments with the best players from all around the globe. You lose, you are out! But this doesn’t end here; you always have another chance to prove yourself with the power of Tokens. Find out more inside the Trivia Loot game!\r\n\r\nTrivia Loot has amazing topics of your interest where you get random sets of questions, with four possible answers, in each contest against your friend or any random player based on the game mode. “Challenge a Friend” is what lets you play against any of your friends and “Play Now” is what connects you with any random player who is also willing to play against some hidden talent!\r\n\r\nPlaying with Tokens lets you earn big! By playing with Tokens you not only improve your rankings throughout the world but also it gives you exclusive access to the Game Loot Rewards where you get a chance to win amazing rewards!\r\n\r\nAre you running out of Tokens? Want to get more? Simply go to the Store and buy as many Tokens as you want!\r\n\r\nSo what are you waiting for? Hit that life-changing INSTALL button and discover the wonders yourself!', '13474-trivialoot_banner.png', '78811-trivialoot_banner.png', '123_568219a80575f.MP4', '123_567f4efc9cf6e.PNG', 'https://play.google.com/store/apps/details?id=com.gamelootnetwork.trivialoot&hl=en', 'https://itunes.apple.com/us/app/trivia-loot/id1035606910?mt=8', 'http://gamelootnetwork.com/', '123_56812475b97a5.png', '2015-12-22 00:29:59'),
(32, 9, 1, 'Road Battle', 0, 'Do you think you have what it takes to drive bike and literally thrash anything that comes in your way? Well, brace yourself to be an awesome, record breaking bike rider as you put your biking skills to test in Road Battle; A very awesome and addictive bike riding game!\r\n\r\nRules are simple, Tilt your device to control your bike, tap on the bottom left side of your screen to increase the speed and tap the bottom right side of the screen to attack! DO NOT hit the Traffic unless you got rocket launchers or grenades to blow them up before you hit them because that will end the game! Easy, right? Well not really! Your motor cycle riding skills will be greatly tested in Road Battle when you try to control your motor cycle, collect coins and weapons, try to hit your opponents to ride easy and avoid traffic! You think you are good? Let’s see what you got!\r\n\r\nRoad Battle is a great way to enjoy your free time as it’s an engaging game with awesome controls and sound!\r\n\r\nRoad Battle Features:\r\n• Highly addicting game play!\r\n• Choose from a wide range of stunning bikes!\r\n• Collect coins and power ups to enjoy the intense game play!\r\n• Gear your motor cycle up with some lethal weapons to outdo your opponent!\r\n• Awesome sounds to keep you entertained while you play!\r\n• Tilt your device to control the motor bike!\r\n• Stunning Graphics!\r\n• Fun game for all age groups!\r\n\r\nStart riding by installing Road battle now and enter into the world of endless fun!', '123_58246597ac8ae.png', '123_58246597ac80d.png', '', '', 'https://play.google.com/store/apps/details?id=com.gamelootnetworks.roadbattle', 'https://itunes.apple.com/us/app/road-battle/id1119393044?ls=1&mt=8', 'http://gamelootnetwork.com/', '123_58246597ac867.png', '2015-12-31 15:31:17'),
(35, 8, 1, 'Rogue Valet', 1, 'Rogue Valet - an epic game, as we have a list of others, coming soon. More details will be made live very soon here about this game.', '123_57290a35ee9e9.png', '123_57290a35ee8ae.png', '', '', 'http://gamelootnetwork.com/', 'http://gamelootnetwork.com/', 'http://gamelootnetwork.com/', '123_57290a35ee96b.png', '2016-01-08 18:28:03'),
(38, 7, 15, 'Blue Yonder Battle', 0, 'Did you always want to be a Fighter Jet pilot but couldn’t due to some unfortunate reasons? Well, brace yourself to be an awesome, record breaking fighter Jet as you put your Fighter Jet flying skills to test in Blue Yonder Battle; a very awesome and addictive game!\r\n\r\nHOW TO PLAY: Tap and drag your thumb across the screen to control the fighter Jet. The Jet starts shooting as well when you tap and drag. Which means you don’t have to worry about flying and shooting at the same time.  Easy, right? Well not really! Your Fighter Jet flying skills will be greatly tested in Blue Yonder Battle when you try to control your Jet, fire at the enemy fighter jets and ships and avoid the bombs of death to keep going and destroying the enemy forces! You think you are good? Let’s see what you got!\r\n\r\nThere are tons of options to help you defeat the enemy, like awesome power-ups, special perks, killer up-gradation to name a few!\r\nIn order to start playing Blue Yonder Battle, you need to make an account on Game Loot Network and sign in using the registered information. No! You don’t have to worry about finding a website, when you launch the game for the first time, you will see the registration screen. Don’t worry! It’s just a few details. As soon as you register and sign in, you are good to go! Why all this? Because registering at Game Loot Network has a lot of perks! Visit: www.gamelootnetwork.com for more information!\r\n\r\nBlue Yonder Battle Features:\r\n•	Highly addictive game play!\r\n•	Delicious graphics!\r\n•	Awesome game sounds to keep you entertained while you play!\r\n•	Tons of challenging levels!\r\n•	Awesome power-ups!\r\n•	Killer up-gradation of your Fighter Jet!\r\n•	Each level comes with different goals!\r\n•	Share your success stories with your Facebook friends!\r\n•	100% FREE gameplay!\r\n•	Fun game for all age groups!\r\n\r\nFor paid part, you need Tokens! Tokens, if you don’t already know, are the virtual currency used in all the fun games of Game Loot Network (www.gamelootnetwork.com ), that you can use to win exciting stuff available on Game Loot Rewards portal (www.gamelootrewards.com).\r\n\r\nDon’t wait! Grab Blue Yonder now and brace yourself to enter the teeth grinding battles against the ruthless enemy! Are you ready to win?!', '123_571f75fcb0414.jpg', '', '123_571f747828665.mp4', '', 'https://play.google.com/store/apps/details?id=com.gamelootnetworks.blueyonderbattle', 'https://play.google.com/store/apps/details?id=com.gamelootnetworks.blueyonderbattle', 'https://gamelootnetwork.com', '123_571f74782861e.jpg', '2016-04-26 19:00:24'),
(40, 6, 16, 'Frozen Treat Frenzy', 0, 'Indulge yourself in this delicious and extremely sweet 3 match puzzle journey towards the ultimate Frozen Treat! Can you create some delicious treats for people to always remember?\r\n\r\nRules are simple, you get a certain number of moves to create your yummy frozen treats; you have to attain a certain score goal. The bigger the match, the higher the candy scores! Watch as you set off an epic chain reaction of candies in the Frozen Treat Frenzy.\r\n\r\nFrozen Treats, Yummy candies, chain reactions, battle with the number of moves – It just keeps getting better! \r\n\r\nIn order to start playing Frozen Treat Frenzy, you need to make an account on Game Loot Network and sign in using the registered information. No! You don’t have to worry about finding a website, when you launch the game for the first time, you will see the registration screen. Don’t worry! It’s just a few details. As soon as you register and sign in, you are good to go! Why all this? Because registering at Game Loot Network has a lot of perks! Visit: www.gamelootnetwork.com for more information!\r\n\r\nFrozen Treat Frenzy Features:\r\n•	Highly addicting game play!\r\n•	Delicious graphics!\r\n•	Awesome game sounds to keep you entertained while you play!\r\n•	Hundreds of challenging yet fun filled levels!\r\n•	Awesome sounds to keep you entertained while you play!\r\n•	Each level comes with different goals!\r\n•	Share your success stories with your Facebook friends!\r\n•	100% FREE gameplay!\r\n•	Fun game for all age groups!\r\n\r\nFor paid part, you need Tokens! Tokens, if you don’t already know, are the virtual currency used in all the fun games of Game Loot Network (www.gamelootnetwork.com ), that you can use to win exciting stuff available on Game Loot Rewards portal (www.gamelootrewards.com).\r\n\r\nBrace yourself for the sweetest journey of your life. Play Frozen Treat Frenzy now!', '123_571f7a2f07d62.png', '', '123_571f78d6a6baf.mp4', '123_571f78d6a6b6e.png', 'https://play.google.com/store/apps/details?id=com.gamelootnetwork.frozertreatfrenzy', 'https://itunes.apple.com/us/app/frozen-treat-frenzy/id1106347570?mt=8', 'https://gamelootnetwork.com', '123_571f78d6a6b29.png', '2016-04-26 19:19:02'),
(41, 10, 16, 'Deep Sea Gold Rush', 0, 'Underwater mining and treasure finding has never been so fun! In one of the most entertaining collecting games you’ll need to dig deep into the sea to find gems and gold. It is a combination of mining, discover, and treasure hunt games that you’ll simply adore. \r\nDISCOVER!\r\nWith our main hero, discover all kinds of lost bounty like gemstones, metals, coins, rare finds and hidden pirate loot in a highly engaging discover game that gives you a real rush and keep you entertained.\r\nCOLLECT THE TREASURE\r\nIn a stunningly designed surroundings with exciting gameplay and audio-visual effects, make sure you reach the goal of each level. All you have is a hook that it is moving from left to right and vice versa. You need to let it go in the right moment.\r\nCHALLENGING GOAL\r\nThe goal of the game is to reach the given goal of money to collect. As you progress, the goal will be higher and higher. This sounds easy, right? And it would’ve been easy if there was no time limit. But there is, so you must collect fast and collect smart. The bigger the gold gem, the more money you will get.\r\nAVOID THE ROCKS, AIM BIGGER\r\nThe hook is constantly moving and it has certain physics of movement. As one of the coin collectors in the game, you’ll need to be as precise as possible. There will be rocks along the way and they will bring you little $$. So, avoid them and aim for the bigger gemstones.\r\nDEEP SEA COLLECT GOLD RUSH FEATURES:\r\n- treasure hunt in the deep sea\r\n- money goal and time limit for each collecting hunt\r\n- discover gemstones, gems, gold coins, metals and rare finds with a hook\r\n- aim for the bigger gold bunches and avoid the rocks\r\n- Unique HD graphics and sound effects\r\n*********************\r\nGet into the free mining and discovery journey under the sea.\r\nGet Deep Sea Collect Gold Rush for FREE!', '123_5824666a8da5c.png', '123_5824666a8d9b6.png', '', '', 'https://play.google.com/store/apps/details?id=com.gamelootnetwork.deepseagoldrush', 'https://itunes.apple.com/us/app/deep-sea-gold-rush/id1160232216?mt=8', 'http://gamelootnetwork.com/', '123_5824666a8da0d.png', '2016-10-14 16:41:17'),
(42, 11, 1, 'Hungry Ninja', 0, 'Hungry Ninja is another exclusive FUN game by Game Loot Network where you get endless game play of running after gourmet. YES, and a super way of making more Tokens.\r\n\r\nHungry Ninja is simple yet makes it challenging to find the right place for gourmet and to avoid cardboards. Don’t get smashed! Stay focused, be clever and be quick. That’s all you need to be the Hungry Ninja!\r\n\r\n\r\nMajor Features:\r\n\r\n\r\n• Amazing 3D graphics!?\r\n• Great sounds! ?\r\n• Unlimited, Exciting and challenging gameplay!?\r\n• Intuitive Controls that keep you alert as you play!?\r\n• Power ups so you feel like Ninja! \r\n• Free and Paid tournaments to make the gameplay more interesting and rewarding!?\r\n\r\n\r\nGo Ninja! What are you waiting for?! Install now and be part of this fun loving gaming community, Game Loot Network!', '123_58243b515c17d.png', '123_58243a9cc71a1.png', '', '123_58243a9cc71e3.png', 'https://play.google.com/store/apps/details?id=com.gamelootnetwork.hungryninja&hl=en', 'https://play.google.com/store/apps/details?id=com.gamelootnetwork.hungryninja&hl=en', 'https://play.google.com/store/apps/details?id=com.gamelootnetwork.hungryninja&hl=en', '123_58243a9cc7159.png', '2016-11-10 14:15:08');
